import { Route, Router, Routes, Switch } from "react-router-dom";
import Home from "./components/Home";
import BookList from "./components/BookList";

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={Home} />
        <Route path="/books" component={BookList} />
      </Switch>
    </Router>
  );
}

export default App;
